import React, { Component } from 'react';
import { Form, Input, Button, Label, Message, Radio, Dropdown } from 'semantic-ui-react';


export default class SignUp extends Component {

	constructor() {
		super();

	}

	render(){
		return(
			<form class="ui form"><div class="field"><label>First Name</label><input placeholder="First Name"/></div><div class="field"><label>Last Name</label><input placeholder="Last Name"/></div><div class="field"><div class="ui checkbox"><input type="checkbox" class="hidden" readonly="" tabindex="0"/><label>I agree to the Terms and Conditions</label></div></div><button type="submit" class="ui button">Submit</button></form>
		);
	}
}



const style = {
	height: 570,
	width: '90%',
	marginTop: '50px',
	marginLeft: '5%',
	marginRight: '5%',
	textAlign: 'center',

};
